interface Vlan11                                                                
 ip vrf forwarding 11                                                      
 ip address 10.11.254.3 255.255.255.0                                            
 standby ip 10.11.254.1                                                          
 standby 1 authentication  
 ip ospf authentication message-digest
 ip ospf message-digest-key 1 md5 
 ip ospf dead-interval minimal hello-multiplier 5
 no shut
 !
 !
! vlan configurations for core1 vrf11
 vlan 11
 name vrf11-fwsm-border-vlan 
 firewall autostate                                                              
 firewall multiple-vlan-interfaces  
 firewall module 1 vlan-group 1  
 firewall vlan-group 1 11
 !
 !
! core 2 vrf 11 loopback
 interface Loopback11
 ip vrf forwarding 11
 ip address 10.252.2.11 255.255.255.255
 no shut
 !
! static route to firewall service module context (or interface) for the trust side
ip route vrf 11 0.0.0.0 0.0.0.0 10.11.254.241
!
